pragma solidity ^0.8.0;
contract FundMe{
    uint256 public minimumUSD = 2;
    address public owner;
    // Constructor for this Smart Contract will be executed when deploying SC
    //initiate owner variable state to the address of the smart contract creator
    constructor (){
        owner = msg.sender;
    }
    modifier onlyOwner(address _caller){
        require(owner == _caller,"only the owner");
        _;
    }
    modifier fundMinumumUSD(uint256 _value){
        require(_value>=minimumUSD,"Didn't send enough");
        _;
    }
    function setMinimumUSD(uint256 _val) public onlyOwner(msg.sender){
        minimumUSD=_val;
    }
    function fund() public payable fundMinumumUSD(msg.value){

    }
}

